import React from "react";

import { IonContent, IonHeader, IonPage } from "@ionic/react";

const ChatPage = () => {

    return (
        <IonPage>
            <IonHeader>Random Guy</IonHeader>
            <IonContent>
                <p>This is the chatpage bro..</p>
            </IonContent>
        </IonPage>
    );
}

export default ChatPage;
